// src/components/Menu.jsx
import { motion } from 'framer-motion';
import PageTransition from './PageTransition';

const menuItems = {
  cocktails: [
    {
      name: "Mojito Classic",
      price: "12€",
      description: "Rum, fresh mint, lime juice, sugar syrup, soda water",
    },
    {
      name: "Old Fashioned",
      price: "14€",
      description: "Bourbon, angostura bitters, sugar cube, orange twist",
    },
    {
      name: "Margarita",
      price: "13€",
      description: "Tequila, triple sec, fresh lime juice, salt rim",
    },
    {
      name: "Cosmopolitan",
      price: "13€",
      description: "Vodka, triple sec, cranberry juice, fresh lime juice",
    },
  ],
  wines: [
    {
      name: "Chardonnay",
      price: "8€",
      description: "Elegant white wine with notes of apple and vanilla",
    },
    {
      name: "Merlot",
      price: "9€",
      description: "Smooth red wine with cherry and chocolate notes",
    },
    {
      name: "Prosecco",
      price: "10€",
      description: "Sparkling wine with fresh citrus and floral aromas",
    },
  ],
  beers: [
    {
      name: "Craft IPA",
      price: "7€",
      description: "Hoppy craft beer with citrus notes",
    },
    {
      name: "Belgian Wheat",
      price: "6€",
      description: "Light and refreshing wheat beer",
    },
    {
      name: "Stout",
      price: "7€",
      description: "Rich and creamy dark beer",
    },
  ],
};

const Menu = () => {
  return (
    <PageTransition>
      <div className="min-h-screen pt-24 pb-12 px-4">
        <div className="max-w-7xl mx-auto">
          <motion.h1
            initial={{ opacity: 0, y: -20 }}
            animate={{ opacity: 1, y: 0 }}
            className="text-4xl md:text-5xl font-bold text-center mb-16"
          >
            Our Menu
          </motion.h1>

          {/* Cocktails Section */}
          <section className="mb-16">
            <motion.h2
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              className="text-3xl font-bold mb-8 text-gold"
            >
              Signature Cocktails
            </motion.h2>
            <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
              {menuItems.cocktails.map((item, index) => (
                <motion.div
                  key={item.name}
                  initial={{ opacity: 0, y: 20 }}
                  whileInView={{ opacity: 1, y: 0 }}
                  transition={{ delay: index * 0.1 }}
                  viewport={{ once: true }}
                  className="bg-gray-900 p-6 rounded-lg"
                >
                  <div className="flex justify-between items-center mb-2">
                    <h3 className="text-xl font-bold">{item.name}</h3>
                    <span className="text-gold font-bold">{item.price}</span>
                  </div>
                  <p className="text-gray-400">{item.description}</p>
                </motion.div>
              ))}
            </div>
          </section>

          {/* Wines Section */}
          <section className="mb-16">
            <motion.h2
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              className="text-3xl font-bold mb-8 text-gold"
            >
              Wines
            </motion.h2>
            <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
              {menuItems.wines.map((item, index) => (
                <motion.div
                  key={item.name}
                  initial={{ opacity: 0, y: 20 }}
                  whileInView={{ opacity: 1, y: 0 }}
                  transition={{ delay: index * 0.1 }}
                  viewport={{ once: true }}
                  className="bg-gray-900 p-6 rounded-lg"
                >
                  <div className="flex justify-between items-center mb-2">
                    <h3 className="text-xl font-bold">{item.name}</h3>
                    <span className="text-gold font-bold">{item.price}</span>
                  </div>
                  <p className="text-gray-400">{item.description}</p>
                </motion.div>
              ))}
            </div>
          </section>

          {/* Beers Section */}
          <section>
            <motion.h2
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              viewport={{ once: true }}
              className="text-3xl font-bold mb-8 text-gold"
            >
              Craft Beers
            </motion.h2>
            <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
              {menuItems.beers.map((item, index) => (
                <motion.div
                  key={item.name}
                  initial={{ opacity: 0, y: 20 }}
                  whileInView={{ opacity: 1, y: 0 }}
                  transition={{ delay: index * 0.1 }}
                  viewport={{ once: true }}
                  className="bg-gray-900 p-6 rounded-lg"
                >
                  <div className="flex justify-between items-center mb-2">
                    <h3 className="text-xl font-bold">{item.name}</h3>
                    <span className="text-gold font-bold">{item.price}</span>
                  </div>
                  <p className="text-gray-400">{item.description}</p>
                </motion.div>
              ))}
            </div>
          </section>
        </div>
      </div>
    </PageTransition>
  );
};

export default Menu;
